import React from "react";
import Message from "../interfaces/Message";
import SimpleSmartphoneComponent from "../components";
import { useTheme, ThemeProvider } from '@mui/material/styles';

export default function Example() {
	const exampleMessages = [{
		messageBody: "This is a message body - it is required",
		media: "data:image/jpeg;base64,"
	},{
		messageBody: "This is a message without an image"
	}];
	const theme = useTheme();
	const ColorModeContext = React.createContext({ toggleColorMode: () => {} });
	const colorMode = React.useContext(ColorModeContext);
	const [statefulMessages, setStatefulMessages] = React.useState<Message[]>(exampleMessages);

	const handleSendMessage = (value: string) => {
	  setStatefulMessages((prev: Message[]) => [...prev, {messageBody: value}]);
	}
	return (
		<ColorModeContext.Provider value={colorMode}>
			<ThemeProvider theme={theme}>
				<SimpleSmartphoneComponent
					onSend={handleSendMessage}
					messages={statefulMessages}
					mainImageUrl={'data:image/jpeg;base64,'}/>
			</ThemeProvider>
		</ColorModeContext.Provider>
	);
}